import React, { useState } from 'react';
import PoultryLogo from '../Asset/PoultryLogo.jpg'
import Cart from '../Asset/Cart.png'
import './Navbar.css';

function Navbar(){
    const[activemenu, setActiveMenu] = useState("shop");
    return(
        <div className="navbar">
            <div className="navbar_logo">
                <img className='logo' src={PoultryLogo} alt="" />
                <p className="logo_name">Commerce</p>

            </div>
            <div className="navbar_menu">
                 <li className="catagory_menu" onClick={()=>setActiveMenu("shop")}>Shop {activemenu ==="shop"? <hr/> : <></>} </li>
                <li className="catagory_menu"  onClick={()=>setActiveMenu("meat")}>Meat {activemenu ==="meat"? <hr/> : <></>} </li>
                <li className="catagory_menu"  onClick={()=>setActiveMenu("eggs")}>Eggs {activemenu ==="eggs"? <hr/> : <></>} </li>
                <li className="catagory_menu"  onClick={()=>setActiveMenu("equipment")}>Equipment {activemenu ==="equipment"? <hr/> : <></>} </li>
               
            </div>

            <div className="login_cart">
                <button className="login">Login</button>
                <img className='cart' src={Cart} alt="Cart"/>
                <div className="cart_count">0</div>
            
            </div>
        </div>
    );
}
export default Navbar;
